import React from "react";
import './base.css';
import { Container, Row, Col } from 'react-bootstrap';


export const Placard = () => {

    return (
    <div className="div-page">
        <Container className="container">
            <div></div>
            <Row>
                <Col xs={6} md={4}>
                Hello, I'm Kaustubh.
                </Col>
            </Row>
        </Container>
    </div>
    );
};

export default Placard;
